import React from "react";
import "./styles.css";
import Montain from "../../assets/Mountain.jpg";

export default class Banner extends React.Component {
  render() {
    return (
      <div>
        <img className="banner-image" src={Montain} />
        <span>teste</span>
      </div>
    );
  }
}
